RECORDS["_427"] = new MedievalDocuments("_427", 1654, "Constantin Șerban voievod întărește lui Stănilă postelnic din Vâlcănești, j. Dolj și vărului său, Radul postelnic și nepotului său, Mihai, fiul lui Drosul postelnic, dreptul de stăpânire asupra satului Salcia de la Motru, j. Mehedinți, cu toți rumânii și cu țigănia.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);aprilie 25");
