RECORDS["_563"] = new MedievalDocuments("_563", 1654, "Egumenul Varlaam al mănăstirii Căldărușani adeverește mitropolitului Ignatie că Mitropolia a fost datoare mănăstirii o țigancă, pe care mitropolitul a plătit-o.", "Română", "Hârtie", "Original", "Constantin Șerban", "Egumenul Varlaam al mănăstirii Căldărușani", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_564"] = new MedievalDocuments("_564", 1654, "Vasile logofăt din Rătevoiești adeverește egumenului Vasile al mănăstirii Bistrița schimbul de țigani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Vasile logofăt din Rătevoiești", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_565"] = new MedievalDocuments("_565", 1654, "Constantin Șerban voievod întărește mănăstirii Bistrița dreptul de stăpânire asupra satului Costești, j. Vâlcea, cu rumâni, vie și muntele Neteda, dăruit acesteia de voievodul Mihai Viteazul.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_566"] = new MedievalDocuments("_566", 1654, "Constantin Șerban voievod întărește Episcopiei de Buzău ocina la Vernești, partea lui Ilarion episcop și a fratelui acestuia, Ivan din Vernești, pentru care mănăstirea fusese prădată cu 600 ughi de către Radu Mihnea voievod.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_567"] = new MedievalDocuments("_567", 1654, "Constantin Șerban voievod întărește lui Nicola Glogoveanul clucer niște rumâni din Broscari, care susțineau că nu sunt rumâni ai clucerului, ci ai marelui vornic Preda Brâncoveanu.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_568"] = new MedievalDocuments("_568", 1654, "Constantin Șerban voievod întărește lui Bunea Grădișteanu mare vistier stăpânirea peste ocina și vecinii din satul Izbiceni, j. Romanați, pe care îl avea de zestre de la socrul sau, Miho spătar.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_569"] = new MedievalDocuments("_569", 1654, "Constantin Șerban voievod întărește boierilor Necula postelnicul, Apostol și Stroe stăpânire asupra satului Poienari <j. Argeș>.", "Română", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_570"] = new MedievalDocuments("_570", 1654, "Constantin Șerban voievod întărește mănăstirii Strehaia dreptul de stăpânire asupra satului Strehaia cu rumânii, închinat acesteia de Matei Basarab voievod.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 25");
RECORDS["_571"] = new MedievalDocuments("_571", 1654, "Belciu vinde lui Stanciul, ginerele său, 5 stânjeni de ocină în funia balotească cu 500 de bani.", "Română", null, "Copie", "Constantin Șerban", "Belciu", null, "Țara Românească", "3", "1654 (7162);iunie 27");
RECORDS["_572"] = new MedievalDocuments("_572", 1654, "Gherghe și nepotul său, Ion se înfrățesc cu Făta, dăruindu-l cu 50 de stânjeni de moșie în Berilești, iar acesta le-a dăruit un caș bun și o bogată de postav.", "Română", null, "Copie", "Constantin Șerban", "Gherghe și nepotul său, Ion", null, "Țara Românească", "3", "1654 (7162);iunie 27");
RECORDS["_573"] = new MedievalDocuments("_573", 1654, "Constantin Șerban voievod iartă de rumânie satul Băbiciu, j. Romanați, care s-a plâns de nedreptatea făcută de răposatul voievod Matei Basarab pe vremea când era boier.", null, null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 28");
RECORDS["_574"] = new MedievalDocuments("_574", 1654, "Constantin Șerban voievod întărește mănăstirii Glavaciog și egumenului Nechifor parte de moșie de la Obislav, <j. Vlașca>, în urma unei judecăți cu megiașii din Coțăieni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 29");
RECORDS["_575"] = new MedievalDocuments("_575", 1654, "Constantin Șerban voievod întărește lui Radu și fratelui său, Neagoe, fiii lui Neagoe postelnic, ocină în satul Cărunți <j. Prahova>.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "<1654-1657> iunie 29");
RECORDS["_576"] = new MedievalDocuments("_576", 1654, "Constantin Șerban voievod poruncește celor 6 boieri judecători ai jupânesei Ilinca, fata lui Mușat vistier și ai nepotului ei, Hriza, fiul lui Vasile spătar, să cerceteze moșiile, rumânii și țiganii lui Mușat vistier.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iunie 30");
RECORDS["_577"] = new MedievalDocuments("_577", 1654, "Constantin Șerban voievod întărește lui Velisarie logofăt și lui Sima negustor moșia Pârțâianii, j. Ialomița și toată partea de moșie din Golăni, împresurate de Matei Basarab voievod „precum au fost luat toate moșiile boierilor țării\".", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iunie 30");
RECORDS["_578"] = new MedievalDocuments("_578", 1654, "Constantin Șerban voievod acordă mănăstirii lui Dan vistiarul de la Colentina și egumenului Mihail dreptul de a face slobozie.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie");
RECORDS["_579"] = new MedievalDocuments("_579", 1654, "Căpitanul Preda Bologa vinde egumenului Teodosie de la mănăstirea Strehaia pe Ghera țiganul cu țiganca sa și copiii lor, cu 30 de ughi, pentru că furase niște cai.", "Română", "Hârtie", "Original", "Constantin Șerban", "Căpitanul Preda Bologa", null, "Țara Românească", "3", "1654 (7162);iulie 1");
RECORDS["_580"] = new MedievalDocuments("_580", 1654, "Ghiera, fost țigan al voievodului Matei Basarab adeverește că a fost răscumpărat de la spânzurătoare de Teodosie, egumenul mănăstirii Strehaia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ghiera, fost țigan al voievodului Matei Basarab", null, "Țara Românească", "3", "1654 (7162);iulie 1");
RECORDS["_581"] = new MedievalDocuments("_581", 1654, "Neagu, mama sa, Voica, și frații săi, vând lui Nan vătaf moșie în Berivoiești <j. Sac>, cu 9 ughi.", "Română", null, "Copie", "Constantin Șerban", "Neagu, mama sa, Voica, și frații săi", null, "Țara Românească", "3", "1654 (7162);iulie 2");
RECORDS["_582"] = new MedievalDocuments("_582", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș satul Corbii de Piatră și metohul Merișul, cu rumânii și țigani, pe hotarele alese de 24 de boieri și om domnesc.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 2");
RECORDS["_583"] = new MedievalDocuments("_583", 1654, "Constantin Șerban voievod întărește lui Iordache postelnic, fiul lui Trufanda vistier, stăpânirea asupra satului Negrășani cu rumânii, j. Vlașca, ce i s-au vândut în timpul domniei lui Matei Basarab voievod.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 3");
RECORDS["_584"] = new MedievalDocuments("_584", 1654, "Constantin Șerban voievod întărește lui Manta roșul, fiul lui Pană din Câmpulung, un vad de moară cu iaz din orașul Câmpulung până în Valea Țigăniei.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 3");
RECORDS["_585"] = new MedievalDocuments("_585", 1654, "Constantin Șerban voievod poruncește rumânilor din Săcele, j. Gorj, să asculte de omul clucerului Nicola, pentru că boierul se afla trimis de domn la Constantinopol.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 3");
RECORDS["_586"] = new MedievalDocuments("_586", 1654, "Constantin Șerban voievod întărește lui Nicolae, năstavnicul m-rii Argeș, dreptul de a ridica dijma de pe toate moșiile mănăstirii de la Segarcea, Găneasa, Bârca, Tătarul și poruncește pârcălabilor să aibă grijă de lucrurile mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 4");
RECORDS["_587"] = new MedievalDocuments("_587", 1654, "Dragomir și Ivan, fiii lui Oprea logofăt, cu vărul lor, Stroe, vând lui Albul fustaș și soției lui, Dobra, un loc de casă în București.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dragomir și Ivan, fiii lui Oprea logofăt, cu vărul lor, Stroe", null, "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_588"] = new MedievalDocuments("_588", 1654, "Constantin Șerban voievod întărește jupânesei Drăgana păhărniceasa, fosta soție a lui Drăgușin paharnic, stăpânire asupra satului Deleni, j. Olt, cu vii și cu rumâni.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_589"] = new MedievalDocuments("_589", 1654, "Constantin Șerban voievod întărește lui Neagu fost mare portar din Vaideei o grădină cu vie în Târgoviște, care a aparținut pe jumătate mănăstirii Stelea și pe jumătate lui Stanciul bacalul.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_590"] = new MedievalDocuments("_590", 1654, "Constantin Șerban voievod întărește lui Stan, Hamza și Aga din Prapăr, j. Romanați, rumâni ai m-rii Brâncoveni, scutirea de bir, de taler, găleată cu fân, de lucru domnesc și de alte slujbe.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 5");
RECORDS["_591"] = new MedievalDocuments("_591", 1654, "Constantin Șerban voievod întărește lui Barbul stolnic din Poiană stăpânirea asupra satelor Sulariul și Băldăluiul, j. Gorj, cu rumânii, pe vechile hotare și semne.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 6");
RECORDS["_592"] = new MedievalDocuments("_592", 1654, "Constantin Șerban voievod întărește mănăstirii Cobia și egumenului Damaschin morile din jos de orașul Târgoviște, făcute de Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 6");
RECORDS["_593"] = new MedievalDocuments("_593", 1654, "Constantin Șerban voievod scrie lui Gherghe vornicul din Serdănești pentru țigăncile de la mănăstirea Strâmba, arătându-i că acestea sunt revendicate de Stamatie paharnic și de Preda paharnic.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 6");
RECORDS["_594"] = new MedievalDocuments("_594", 1654, "Constantin Șerban scrie celor 24 de boieri, luați de jupâneasa Dumitra din Masloși, să adeverească și pentru moșia lui Ianoș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_595"] = new MedievalDocuments("_595", 1654, "Constantin Șerban voievod poruncește celor 12 megiași jurători ai satului Groșanii, din j. Muscel, să jure dacă sătenii au fost sau nu rumâni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_596"] = new MedievalDocuments("_596", 1654, "Constantin Șerban voievod întărește egumenului de la mănăstirea Radu vodă din București dijma de pe toate moșiile mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_597"] = new MedievalDocuments("_597", 1654, "Constantin Șerban voievod întărește lui Stamatie paharnic să fie volnic să-și ia o țigancă de la Gherghie vornic din Sărdănești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 8");
RECORDS["_598"] = new MedievalDocuments("_598", 1654, "Ivan postelnic, fiul lui Oprea logofăt și al Mariei, împreună cu vărul său, Stroe, nepoții lui Mitrea, fost mare vornic, vând lui Greșiță al doilea postelnic și jupânesei lui, Stanca, un loc de casă, pentru 30 de ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Ivan postelnic, fiul lui Oprea logofăt și al Mariei, împreună cu vărul său, Stroe, nepoții lui Mitrea, fost mare vornic", null, "Țara Românească", "3", "1654 (7162);iulie 10");
RECORDS["_599"] = new MedievalDocuments("_599", 1654, "Radoslav, cu frații săi, și Ivan, cu frații și verii săi, din Dăiești, j. Vâlcea, adeveresc lui Preda și lui Udriște din Șărineasca că au avut pâră pentru niște năpăști pe care le-au plătit aceștia din urmă.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radoslav, cu frații săi, și Ivan, cu frații și verii săi, din Dăiești", null, "Țara Românească", "3", "1654 (7162);iulie 10");
RECORDS["_600"] = new MedievalDocuments("_600", 1654, "Stan, fiul călugărului Uriil, vinde lui Radul și soției sale, Neacșa, viile din Piscul Radului, cu 12 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Stan, fiul călugărului Uriil", null, "Țara Românească", "3", "1654 (7162);iulie 10");
RECORDS["_601"] = new MedievalDocuments("_601", 1654, "Radu și Draghiul, fiii lui Stan, nepoții lui Draghiul din Balomirești, mărturisesc strâmb pentru rumânii din Ionești, j. Vlașca, ai lui Iordachi postelnic, fiul lui Trufanda vistier.", null, null, null, "Constantin Șerban", "Radu și Draghiul, fiii lui Stan, nepoții lui Draghiul din Balomirești", null, "Țara Românească", "3", "1654 (7162);iulie 13");
RECORDS["_602"] = new MedievalDocuments("_602", 1654, "Megiașii din satul Turburea se vând rumâni lui Pană cămăraș cu fiii, viile și moșiile lor.", "Română", "Hârtie", "Original", "Constantin Șerban", "Megiașii din satul Turburea", null, "Țara Românească", "3", "1654 (7162);iulie 13");
RECORDS["_603"] = new MedievalDocuments("_603", 1654, "Constantin Șerban voievod poruncește celor 12 boieri jurători ai satului Scurtești <j. Buzău> să jure la Episcopia din Buzău, împreună cu satul că nu știu când a cumpărat Moise spătar din Cândești moșia din Scurtești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 13");
RECORDS["_604"] = new MedievalDocuments("_604", 1654, "Constantin Șerban voievod întărește jupânesei Elina băneasa, soția răposatului Radu Buzescu, și fiului ei, Matei coconul, satele Rătunda, Poiana, Ciuperceni, Ghidiciul și altele, după judecata cu Vasile postelnic din Breasta.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 14");
RECORDS["_605"] = new MedievalDocuments("_605", 1654, "Constantin Șerban voievod întărește egumenului Nichifor de la mănăstirea Plumbuita dijma de pe moșiile mănăstirii de la Boldorogești și Plăseni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 14");
RECORDS["_606"] = new MedievalDocuments("_606", 1654, "Radul, fiul lui Cârstian Golescul din Oteșani, își pune zălog moșia sa la Dumitru, nepotul său, pentru a răscumpăra mai multe obiecte de valoare lăsate în gaj la Fiera logofăt, când a fugit în Transilvania.", "Română", null, "Copie", "Constantin Șerban", "Radul, fiul lui Cârstian Golescul din Oteșani", null, "Țara Românească", "3", "1654 (7162);iulie 15");
RECORDS["_607"] = new MedievalDocuments("_607", 1654, "Sătenii din Bresnița de Jos și Sus <j. Mehedinți> mărturisesc pentru 300 de ughi luați de la Mihai clucer și de la Răduțul iuzbașa cu dobândă.", "Română", null, "Copie", "Constantin Șerban", "Sătenii din Bresnița de Jos și Sus", null, "Țara Românească", "3", "1654 (7164);iulie 16");
RECORDS["_608"] = new MedievalDocuments("_608", 1654, "Radul globnic și Rădan globnic plătesc o țigancă și pe fiica ei, luate de la Mihalache spătar, căruia domnul Matei Basarab i le dăruise la nuntă.", "Română", "Hârtie", "Original", "Constantin Șerban", "Radul globnic și Rădan globnic", null, "Țara Românească", "3", "1654 (7162);iulie 16");
RECORDS["_609"] = new MedievalDocuments("_609", 1654, "Constantin Șerban voievod întărește lui Hriza paharnic, fiul lui Vasile spătar, nepotul lui Mușat vistier din Pietroșani, j. Mușcel, moșie în lzvorani, în urma judecății cu mătușa lui, Ilinca, pentru că aceasta se lepădase de datoriile tatălui ei, Mușat vistier, la moartea acestuia.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 16");
RECORDS["_610"] = new MedievalDocuments("_610", 1654, "Constantin Șerban voievod întărește călărașilor din Mârzănești stăpânirea peste ocina lor din sat, în urma judecății în divan cu fiii popii Cândea din Brâncoveni.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 16");
RECORDS["_611"] = new MedievalDocuments("_611", 1654, "Constantin Șerban voievod întărește lui Stanciul căpitan de călărași din Hodivoaia moșia Boteneasca, j. Vlașca, pentru dreaptă și credincioasă slujbă.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 16");
RECORDS["_612"] = new MedievalDocuments("_612", 1654, "Voicu, fiul Sorei, vinde Cândei din Mircești ocină la Mircești, j. Vlașca, două părți dintr-o funie cu 9 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Voicu, fiul Sorei", null, "Țara Românească", "3", "1654 (7164);iulie 17");
RECORDS["_613"] = new MedievalDocuments("_613", 1654, "Constantin Șerban voievod întărește nepoatei sale, jupâneasa Ancuța, stăpânirea asupra moșiei Baciul <j. Teleorman>, având dreptul să-și ia dijma.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 17");
RECORDS["_614"] = new MedievalDocuments("_614", 1654, "Manta, vărul său, popa Necula și Marica, nepoata lor, fata fratelui lui Manta, Franța din Câmpulung, vând egumenului Variam de la mănăstirea Câmpulung un vad de moară, în urma unui proces.", "Română", "Hârtie", "Original", "Constantin Șerban", "Manta, vărul său, popa Necula și Marica, nepoata lor, fata fratelui lui Manta, Franța din Câmpulung", null, "Țara Românească", "3", "1654 (7164);iulie 18");
RECORDS["_615"] = new MedievalDocuments("_615", 1654, "Șase boieri jurători luați de Necula diacon mărturisesc pentru viile de la Valea Teancului <j. Sac> ale lui Necula diacon, fiul lui Costandin diacon din Buzău.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șase boieri jurători", null, "Țara Românească", "3", "1654 (7164);iulie 18");
RECORDS["_616"] = new MedievalDocuments("_616", 1654, "Constantin Șerban voievod întărește lui Cârstea iuzbașa de roșii și jupânesei acestuia, Neacșa, pe Stanca țiganca, în urma unui proces cu popa Oana din Căldărușani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 18");
RECORDS["_617"] = new MedievalDocuments("_617", 1654, "Mitropolitul Ignatie al Ungrovlahiei întărește viile și moșiile Episcopiei Buzăului și episcopului Serafim, în urma unei judecăți cu Vasilie ungurul și cu urmașii episcopului Ilarion, ctitori ai mănăstirii Adâncata.", "Română", "Hârtie", "Original", "Constantin Șerban", "Mitropolitul Ignatie al Ungrovlahiei", null, "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_618"] = new MedievalDocuments("_618", 1654, "Iova și Bratul ceauș din Bârsești fac schimb de țigani cu mănăstirea Căldărușani, făcându-și reciproc zapise.", "Română", "Hârtie", "Original", "Constantin Șerban", "Iova și Bratul ceauș din Bârsești", null, "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_619"] = new MedievalDocuments("_619", 1654, "Porumb, fiul lui Nastasie din Pârșcov, vinde diaconului Costandin, fiul popii Dobrul din Aldenii de Jos, 2 pogoane de vie în dealul Săsenilor <j. Sac>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Porumb, fiul lui Nastasie din Pârșcov", null, "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_620"] = new MedievalDocuments("_620", 1654, "Constantin Șerban voievod întărește mănăstirii Radu Vodă și egumenului Serafim doi copii de țigan, Stan și Marin, în urma judecății cu Andrei, fiul lui Andrei din Rogoz.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 23");
RECORDS["_621"] = new MedievalDocuments("_621", 1654, "Constantin Șerban voievod poruncește lui Vasilie armașul să lase dijma de pe moșia Vlădeni mănăstirii Căldărușani, pentru că moșia fusese vândută de tatăl lui Vasilie armaș lui Loiz sluger, care apoi a vândut-o mănăstirii.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 24");
RECORDS["_622"] = new MedievalDocuments("_622", 1654, "Constantin Șerban voievod hotărăște lui Radu Cocorăscu fost mare logofăt satul Tâncăbești, j. Ilfov.", "Română", null, "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 25");
RECORDS["_623"] = new MedievalDocuments("_623", 1654, "Constantin Șerban voievod hotărăște 12 boieri să jure pentru partea de moșie a lui Neagoe păhărnicel dinspre egumenul de la mănăstirea Izvorani.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 25");
RECORDS["_624"] = new MedievalDocuments("_624", 1654, "Constantin Șerban voievod întărește lui Necula diaconul, fiul lui Constantin diaconul din Buzău, patru pogoane de vie de la Valea Teancului <j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 26");
RECORDS["_625"] = new MedievalDocuments("_625", 1654, "Constantin Șerban voievod poruncește celor 12 boieri hotarnici ai lui Vlaica postelnic să aleagă hotarul Cornetului dinspre hotarul Mileștilor, al lui Danciul mare sluger Milescu.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 26");
RECORDS["_626"] = new MedievalDocuments("_626", 1654, "Dragul, fiul lui Curesie, mătușa sa, Slavița, și fiul lui, Costandin, vând lui Nicula Ghiurmescul moșia Brăgărească în j. Sac, moșie stearpă, fără rumâni.", "Română", "Hârtie", "Original", "Constantin Șerban", "Dragul, fiul lui Curesie, mătușa sa, Slavița, și fiul lui, Costandin", "13689", "Țara Românească", "3", "1654 (7164);iulie 27");
RECORDS["_627"] = new MedievalDocuments("_627", 1654, "Constantin Șerban voievod întărește lui Mareș <Băjescu> logofăt stăpânirea asupra unui rumân, Cârstea Capotă cu fiii lui, din satul Băjești, j. Muscel și Pădureț, cu partea lui de moșie și cu vad de moară, cumpărat de la Drăghici, fiul lui Muja din Rătești.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7164);iulie 27");
RECORDS["_628"] = new MedievalDocuments("_628", 1654, "Constantin Șerban voievod întărește egumenului Nicolae de la mănăstirea Argeș dijma de pe moșia Segarcea <j. Olt>, jumătate din tot venitul, pentru că această moșie a fost danie din partea lui Constantin, fiul lui Preda, nepotul Bădicanului, dar fusese uzurpată de ruda acestuia, Preda postelnic din Greci.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7164);iulie 27");
RECORDS["_629"] = new MedievalDocuments("_629", 1654, "Cârstea și Mușat, fiii lui Marte, vând postelnicului Vintilă 50 de stânjeni din moșia din Lățeasca, cu 35 de bani stânjenul.", "Română", null, "Copie", "Constantin Șerban", "Cârstea și Mușat, fiii lui Marte", null, "Țara Românească", "3", "1654 (7164);iulie 28");
RECORDS["_630"] = new MedievalDocuments("_630", 1654, "Costea și fratele lui, Marte, vând postelnicului Vintilă 50 de stânjeni din moșia Lățească, cu 35 bani stânjenul.", "Română", null, "Copie", "Constantin Șerban", "Costea și fratele lui, Marte", null, "Țara Românească", "3", "1654 (7164);iulie 28");
RECORDS["_631"] = new MedievalDocuments("_631", 1654, "Constantin Șerban voievod scrie județului ȘI orășenilor din Argeș să nu se atingă de vamă până la Sf. Dimitrie, când se vor confrunta cu egumenul mănăstirii Argeș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_632"] = new MedievalDocuments("_632", 1654, "Constantin Șerban voievod întărește lui Mareș <Băjescu> logofăt ocină în satul Hurezi, j. Teleorman, în urma judecății în divan cu Micul, fiul lui Ion din Țigănești.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_633"] = new MedievalDocuments("_633", 1654, "Constantin Șerban voievod întărește lui Popescul căpitan din orașul Buzău ocină în siliștea numită Albeștii de pe Călmățui, j. Buzău.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_634"] = new MedievalDocuments("_634", 1654, "Constantin Șerban voievod întărește mănăstirii Radu Vodă din București dreptul de stăpânire asupra unor rumâni „peticari\" din satul Bălteni, j. Ilfov.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 28");
RECORDS["_635"] = new MedievalDocuments("_635", 1654, "Tărchilă și fratele lui, Neagul, vând lui Moise spătar din Cândești moșiile din Scurtești, j. Buzău, ca să poată să acopere cheltuiala făcută din cauza furtului unor stupi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Tărchilă și fratele lui, Neagul", null, "Țara Românească", "3", "1654 (7162);iulie 29");
RECORDS["_636"] = new MedievalDocuments("_636", 1654, "Constantin Șerban voievod întărește eliberarea din rumânie a moșnenilor din satul Groșani, j. Mușcel și Pădureț, de către mănăstirea Câmpulung.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 29");
RECORDS["_637"] = new MedievalDocuments("_637", 1654, "Constantin Șerban voievod întărește lui Vintilă iuzbașa și lui Cândea postelnic din Balotești satele Voivodeștii, Futeștii, Crăceștii, Scăieștii și altele din j. Teleorman.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 29");
RECORDS["_638"] = new MedievalDocuments("_638", 1654, "Constantin Șerban voievod întărește lui Felca din Urechești, fiul lui Dan, nepotul lui Felca vornic, jumătate din ocina satului, în urma unei judecăți cu Constantin, fiul lui Radu fost mare armaș, care o cumpărase în mod abuziv.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 30");
RECORDS["_639"] = new MedievalDocuments("_639", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș și egumenului Nicolae o vie în dealul Goleștilor, <j. Argeș>, cumpărată de egumenul Leontie de la Dumitra și de la fiul ei, Albul, orășeni din Curtea de Argeș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 31");
RECORDS["_640"] = new MedievalDocuments("_640", 1654, "Constantin Șerban voievod întărește mănăstirii Argeș și egumenului Nicolae dijma și venitul satului Nucșoara, j. Muscel.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);iulie 31");
RECORDS["_641"] = new MedievalDocuments("_641", 1654, "Constantin Șerban voievod întărește jupânesei Rada, fiica lui Păcală din Rătești, cu surorile ei, Stancea și Neacșa, moșiile Plăticești și Sărăști, în urma unei judecăți.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);iulie 31");
RECORDS["_642"] = new MedievalDocuments("_642", 1654, "Constantin Șerban voievod întărește Mitropoliei din orașul Târgoviște vinăriciul din dealul Aninoasei, j. Dâmbovița.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august");
RECORDS["_643"] = new MedievalDocuments("_643", 1654, "Alisafta călugărița, care a fost soția lui Șteful logofăt din Pitești de Pasărea, j. Ilfov, cu nora, Rada, și fiul, Pătrașcu, vând lui Radul logofăt, ocină din moșia lor de la Pitești, 100 stânjeni cu 15 ughi.", "Română", null, "Copie", "Constantin Șerban", "Alisafta călugărița", null, "Țara Românească", "3", "1654 (7162);august 1");
RECORDS["_644"] = new MedievalDocuments("_644", 1654, "Constantin Șerban voievod hotărăște ca moșnenii satului Craiovița, din j. Dolj, să fie în pace și slobozi de rumânie de către Diicul spătar Buicescu.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 1");
RECORDS["_645"] = new MedievalDocuments("_645", 1654, "Novac negustor din Micești, j. Muscel, și soția sa, Iana, vând lui Iane negustor și lui Pană moșie în satul Groși, j. Argeș.", "Română", "Hârtie", "Original", "Constantin Șerban", "Novac negustor din Micești, și soția sa, lana", null, "Țara Românească", "3", "1654 (7162);august 2");
RECORDS["_646"] = new MedievalDocuments("_646", 1654, "Constantin Șerban voievod întărește lui Radu logofăt Dudescu, fiul lui Dumitru Dudescu vistier, ocină în Bonțeștii de Jos, j. Ilfov.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 2");
RECORDS["_647"] = new MedievalDocuments("_647", 1654, "Constantin Șerban voievod întărește mănăstirii Sadova și egumenului Pahomie satele Zăvalul și Gârleani, din j. Dolj.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 2");
RECORDS["_648"] = new MedievalDocuments("_648", 1654, "Constantin Șerban voievod scutește mănăstirea Bradul de plata unor dăjdii, precum și cincizeci oameni, poslușnici ai mănăstirii.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 3");
RECORDS["_649"] = new MedievalDocuments("_649", 1654, "Constantin Șerban voievod întărește lui Mihai ceauș și fraților săi, Stanciul, Lupul și Ancul, fiii lui Cârstea din satul Cacaleți, j. Vlașca, stăpânirea asupra unor părți de ocină la Novaci, j. Teleorman.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 3");
RECORDS["_650"] = new MedievalDocuments("_650", 1654, "Constantin Șerban voievod întărește Stamatei, fata lui Crivăț, și mătușilor ei, Neaga și Maria, fetele lui Stoica Boblicescul din Șovârcu, j. Vlașca, ocină în satele Șovârcul și Gurbanul.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 3");
RECORDS["_651"] = new MedievalDocuments("_651", 1654, "Șerban și fiii lui, Stanciu și Tănasie, vând paharnicului Pătrașco și fratelui acestuia, Giura din Morânglav, partea lor de moșie din Pulași, aflată dincoace de Olt.", "Română", "Hârtie", "Original", "Constantin Șerban", "Șerban și fiii lui, Stanciu și Tănasie", null, "Țara Românească", "3", "1654 (7162);august 4");
RECORDS["_652"] = new MedievalDocuments("_652", 1654, "Constantin Șerban voievod poruncește lui Filip postelnic din Baia și celor înfrățiți cu el care își vânduseră părțile lor de moșie lui Matei Basarab voievod să aducă la domnie banii pe care îi plătise voievodul, deoarece marele slujer Danciu Pârșcoveanul se plânsese că fusese nevoit să vândă moșia fără voia lui.", null, null, "Rezumat", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 4");
RECORDS["_653"] = new MedievalDocuments("_653", 1654, "Vasile căpitan și jupâneasa lui, Stana, vând lui Stoia chihaia căpitan și jupânesei lui, Sora, partea lui din Clinceni <j. Ilfov>, cu 31 ughi.", "Română", "Hârtie", "Original", "Constantin Șerban", "Vasile căpitan și jupâneasa lui, Stana", null, "Țara Românească", "3", "1654 (7162);august 5");
RECORDS["_654"] = new MedievalDocuments("_654", 1654, "Constantin Șerban voievod întărește lui Moise spătar din Cândești vii și moșie la Scurtești, în urma procesului avut cu Neagul și alți săteni din Scurtești <j. Buzău>.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 6");
RECORDS["_655"] = new MedievalDocuments("_655", 1654, "Mihăilă, soția sa, Trandafira și copiii lor vând lui Ghinea Stroe o vie <la Căzănești>.", "Română", null, "Copie", "Constantin Șerban", "Mihăilă, soția sa, Trandafira și copiii lor", null, "Țara Românească", "3", "1654 (7162);august 8");
RECORDS["_656"] = new MedievalDocuments("_656", 1654, "Ghiorma Alexeanu mare ban al Craiovei întărește mănăstirii Bucovăț stăpânirea peste moșiile de la Smârdeștița, după ce s-au pârât cu urmașii lui Drăgușin <Deleanu>, mare paharnic.", "Română", null, "Copie", "Constantin Șerban", "Ghiorma Alexeanu mare ban al Craiovei", null, "Țara Românească", "3", "1654 (7162);august 8");
RECORDS["_657"] = new MedievalDocuments("_657", 1654, "Ghiorma Alexeanu mare ban al Craiovei întărește lui Vădislav clucer din Belcin rumâni în Cârna, pe care i-au apucat Legătura lui Mihai în satul lui Vădislav.", null, null, null, "Constantin Șerban", "Ghiorma Alexeanu mare ban al Craiovei", null, "Țara Românească", "3", "1654 (7162);august 8");
RECORDS["_658"] = new MedievalDocuments("_658", 1654, "Staico, fiul lui Bărcan iuzbașa din Miroși, mărturisește că a luat, împreună cu Ion portar, 34 ughi de la satul Stoienești, fără dreptate, pe vremea lui Matei Basarab voievod.", "Română", "Hârtie", "Original", "Constantin Șerban", "Staico, fiul lui Bărcan iuzbașa din Miroși", null, "Țara Românească", "3", "1654 (7162);august 9");
RECORDS["_659"] = new MedievalDocuments("_659", 1654, "Vișan dăruiește, la moartea sa, varei sale, Maria, moșie în Ogrăzeni.", null, null, "Rezumat", "Constantin Șerban", "Vișan", null, "Țara Românească", "3", "1654 (7162);august 10");
RECORDS["_660"] = new MedievalDocuments("_660", 1654, "Constantin Șerban voievod întărește lui Radu logofăt Dudescu moșiile din Scurtești, j. Buzău și satul Râmniceni, pe Sărățel, amândouă cu vii și cu mori, pentru că au fost cumpărate de tatăl acestuia, Dumitru vistier, iar apoi au fost confiscate de domnul Matei Basarab.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 10");
RECORDS["_661"] = new MedievalDocuments("_661", 1654, "Constantin Șerban voievod întărește lui Gavrilă și lui Vlad Țigănuș, fiii lui Stanciul, din satul Băicoi, j. Prahova, dreptul de stăpânire asupra părții lor de ocină din Bibarsă, j. Sac.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 11");
RECORDS["_662"] = new MedievalDocuments("_662", 1654, "Constantin Șerban voievod întărește mănăstirii Brâncoveni și egumenului Gavril ocina de la Robănești și ocina Vlășcii, cumpărate și dăruite mănăstirii de domnul Matei Basarab.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 12");
RECORDS["_663"] = new MedievalDocuments("_663", 1654, "Constantin Șerban voievod întărește lui Mihalașco logofăt, ginerele lui Mitrea pitar din Stănești și lui Pătrașco clucer, tot din Stănești, dreptul de stăpânire asupra satului Cureștii, care a fost de moștenire al lui Mitrea pitar și al lui Cernica vornic cel bătrân, din Săcuiani.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 12");
RECORDS["_664"] = new MedievalDocuments("_664", 1654, "Jupâneasa Vișa, soția pitarului Neagoe Grama din Cepturi adeverește că a cumpărat ocină în Grozești <j. Sac>, pe care apoi a dăruit-o, văduvă fiind, mănăstirii care se află în satul Grozești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Jupâneasa Vișa, soția pitarului Neagoe Grama din Cepturi", null, "Țara Românească", "3", "1654 (7162);august 14");
RECORDS["_665"] = new MedievalDocuments("_665", 1654, "Constantin Șerban voievod reîntărește mănăstirii Vieroșu și egumenului Nichifor părți de moară la Pitești, j. Muscel, dăruite cu mult timp în urmă de ctitorul mănăstirii, boierul Ivașco mare vornic din Golești.", "Română", null, "Copie", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 14");
RECORDS["_666"] = new MedievalDocuments("_666", 1654, "Gherghe, fiul lui Tatu din Șchiopeni <j. Rm. Sărat> se înfrățește cu Crâstea, fiul lui Bratu din Coietești pe o ocină.", "Română", "Hârtie", "Original", "Constantin Șerban", "Gherghe, fiul lui Tatu din Șchiopeni", null, "Țara Românească", "3", "1654 (7162);august 16");
RECORDS["_667"] = new MedievalDocuments("_667", 1654, "Constantin Șerban voievod întărește mănăstirii Arnota și egumenului Theofil dijma, venitul și vinăriciul domnesc din Bărbătești și Dobriceni, j. Vâlcea.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 17");
RECORDS["_668"] = new MedievalDocuments("_668", 1654, "Constantin Șerban voievod reîntărește satului Bărbătești, slobozia mănăstirii Arnota, j. Vâlcea, scutirea de bir și de toate dările, potrivit hrisovului de scutire al domnului Matei Basarab.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", null, "Țara Românească", "3", "1654 (7162);august 17");
RECORDS["_669"] = new MedievalDocuments("_669", 1654, "Răduțul clucer din Medvejde se obligă să dea mănăstirii Tismana o copilă de țigan.", "Română", "Hârtie", "Original", "Constantin Șerban", "Răduțul clucer din Medvejde", null, "Țara Românească", "3", "1654 (7162);august 18");
RECORDS["_670"] = new MedievalDocuments("_670", 1654, "Constantin Șerban voievod întărește mănăstirii Cozia și egumenului Ștefan scutirea de bir a satului Călimănești, j. Vâlcea, ca să fie de ajutor pentru aducerea bucatelor mănăstirii.", "Slavonă", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 18");
RECORDS["_671"] = new MedievalDocuments("_671", 1654, "Constantin Șerban voievod reîntărește mănăstirii Cozia satul Frăsinetul de Câmp din j. Romanați, sat dăruit de mama voievodului Mihai Viteazul, călugărița Theofana și contestat mai apoi de moștenii satului și de un grup de boieri care aveau cumpărături în sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 18");
RECORDS["_672"] = new MedievalDocuments("_672", 1654, "Constantin Șerban voievod întărește mănăstirii Cozia și egumenului Ștefan vinăriciul din satul Jiblea j. Argeș, în urma cererii călugărilor de a face schimb, vinărici pentru vinărici cu daniile domnilor anteriori, care le dăruiseră vinăriciul domnesc din orașul Râmnic și ulița mare a orașului.", "Slavonă", null, "Copie", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7162);august 18");
