RECORDS["_727"] = new MedievalDocuments("_727", 1654, "Constantin Șerban voievod întărește mănăstirii Tismana dreptul de stăpânire asupra satului Tismana, pe care-l scutește de plata oricărei dări.", "Slavonă", "Pergament", "Original", "Constantin Șerban", "Constantin Șerban", "13689", "Țara Românească", "3", "1654 (7163);septembrie 11");
