RECORDS["_731"] = new MedievalDocuments("_731", 1654, "Gavril călugărul, popa Vlad și Antonie din Bunești dăruiesc 17 locuri din moșia satului Episcopiei de la Râmnic.", "Română", "Hârtie", "Original", "Constantin Șerban", "Gavril călugărul, popa Vlad și Antonie din Bunești", null, "Țara Românească", "3", "1654 (7163);septembrie 13");
RECORDS["_732"] = new MedievalDocuments("_732", 1654, "Andrei, fiul lui Vladul cel Bătrân din Cotenești, și jupâneasa lui, Rada, refac zapisul de vânzarea moșiei lor din Voinești, <j. Dâmbovița> cu tot cu rumâni, mănăstirii Câmpulung, pentru că aceste acte pieriseră în incendiul care arsese mănăstirea.", "Română", "Hârtie", "Original", "Constantin Șerban", "Andrei, fiul lui Vladul cel Bătrân din Cotenești, și jupâneasa lui, Rada", "1038", "Țara Românească", "3", "1654 (7163);septembrie 14");
RECORDS["_733"] = new MedievalDocuments("_733", 1654, "Douăzeci și patru boieri confirmă, împreună cu orășenii din Câmpulung, hotarele moșiei Voinești a mănăstirii Câmpulung, așa cum fuseseră alese de fostul egumen al mănăstirii, Melchisedec și confirmă posesia mănăstirii asupra satului Bădești.", "Română", "Hârtie", "Original", "Constantin Șerban", "Douăzeci și patru boieri", "1038", "Țara Românească", "3", "1654 (7163);septembrie 14");
RECORDS["_734"] = new MedievalDocuments("_734", 1654, "Douăzeci și patru jurători luați de mănăstirea Câmpulung arată că satele Groșanii și Bădești sunt sate cu rumâni ale mănăstirii Câmpulung, dăruite din „descălecatul\" țării, de domnul Nicolae Alexandru.", "Română", "Hârtie", "Original", "Constantin Șerban", "Douăzeci și patru boieri hotarnici și jurători", "1038", "Țara Românească", "3", "1654 (7163);septembrie 15");
