RECORDS["_751"] = new MedievalDocuments("_751", 1654, "Unchiașul Coman Enășescul din Dragoslavele, împreună cu feciorii lui, mărturisesc egumenului Varlaam de la Câmpulung, că au vândut domnului Matei Basarab satul Bădeni, <j. Mușcel>, acesta dăruindu-l mănăstirii. Susținând în divanul lui Constantin Șerban voievod că satul le fusese luat cu sila, Coman Enășescul și fiii săi au rămas de lege în fața egumenului Varlaam.", "Română", "Hârtie", "Original", "Constantin Șerban", "Unchiașul Coman Enășescul din Dragoslavele, împreună cu feciorii lui", null, "Țara Românească", "3", "1654 (7163);octombrie 11");
RECORDS["_752"] = new MedievalDocuments("_752", 1654, "Varvara, jupâneasa lui Socot Cornățeanu clucer, cu fiii săi, și Anca, jupâneasa lui Ianache Cornățeanu sluger, cu fiul său, vând vornicului Colțea din Doicești moșia lor de la Pârliți, j. Ialomița, fără rumâni.", "Română", null, "Copie", "Constantin Șerban", "Varvara, jupâneasa lui Socot Cornățeanu clucer, cu fiii săi, și Anca, jupâneasa lui Ianache Cornățeanu sluger, cu fiul său", null, "Țara Românească", "3", "1654 (7163);octombrie 11");
RECORDS["_753"] = new MedievalDocuments("_753", 1654, "Doisprezece boieri luați pe răvașe domnești de satul Scurtești, <j. Buzău>, și de Moise Mihalcea Cândescu Mihălcescu spătar jură înaintea episcopului de Buzău, Serafim, pentru moșiile din sat.", "Română", "Hârtie", "Original", "Constantin Șerban", "Doisprezece boieri", null, "Țara Românească", "3", "1654 (7163);octombrie 12");
